\b0 \ This acts as the "Main Menu" for the entire admin-site of the application.\ \ It also includes two "quick search" options at the top of the page.\ \ There are two roles for Staff Members who are using the ChMS Membership Subsystem:\ \'95 Staff User\ \'95 ChMS Administrator\ \ For the most part, ChMS Administrators have the ability to add/delete other users, and also have the capability of setting permissions on each Staff User. Staff Users can have the following permissions set on it:\ \'95 CanViewStewardship\ \'95 CanViewConfidentialNotes\ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ The \b Administration \b0 button and tab (in the navbar) is only accessible to those ChMS Users that have this permission.}

