\f0\b\fs18 \cf0 Search for a Household\
\b0 \ This allows the user to search for an a specific household in the ChMS.\ \ A household is a family unit that lives in the same address.\ \ Note that roommates (e.g. two friends living in the same apartment) do NOT constitute a single household. If both roommates are single, they would both be in two distinct one-person households that happen to have the same address.\ \ Households must have at least one individual in it.\ \ Individuals must be part of at least one household (even if it is a single-individual household).\ \ Individuals may be part of multiple households.\ \ \ \ \ \ \ \ \ \ Link will take the user to \b Screen 3.2 \b0 for that household.}

